import React, { Component} from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: 'original'
    }
  }

  componentDidUpdate() {
    fetch('/')
    .then((response) => console.log(response.json))
  }

  render() { 
    console.log(this.state.title);
    return (
      <div>
        {this.state.title}
      </div>
    );
  }
}

export default App;
